import logo from 'images/logo.svg';
import 'styles/test.css';

function App() {
  return (<>
    <header>
      <a href="/">
        <img src={logo} alt='Website logo'/>
      </a>
      <nav>
        <ul>
          <li>About</li>
          <li>Resources</li>
          <li class="selected">Glazes</li>
        </ul>
      </nav>
    </header>
    </>);
}

export default App;
